import react from 'react'

//import components
// import ProProjects from './ProProjects'
// import ProjectRpi from './ProjectRpi'

// import data
import fitnessData from '../../../public/static/data/fitness'

const FitnessItem = (props) => {
    return (
        <div className='fitnessContainer'>
            {/* {(props.id === 'esri' || props.id === 'myipcs') &&
                <ProProjects data={projectsData.proProjects[`${props.id}`]} />
            }
            {(props.id === 'rpi' || props.id === 'chatbot') &&
                <ProjectRpi data={projectsData.academicProjects[`${props.id}`]} />
            } */}


            {data = projectsData.proProjects[`${props.id}`]}

            <FitnessContent data={data} />

            <style jsx>{`
                .fitnessContainer {
                    // border: blue 2px solid;
                    width: 100%;
                    margin-top: 80px;
                    margin-bottom: 120px;
                    // min-height: 200px;
                }
            `}</style>
        </div>
    )
}

export default FitnessItem
